window.bookSummaryJSON = "<p>\"The end always happens faster than you think.\" </p> <p>Once there were hundreds of members of the Oversight, the brave souls who guard the borders between the mundane and the magic. Now there are only five. </p> <p>When a vagabond brings a screaming girl to the Oversight's London headquarters, she could answer their hopes for new recruit, or she could be the instrument of their downfall.</p>"; 
